import React from 'react';
import '../index.css';

function Success(){
    const [poitactive, setPointActive] = React.useState(1);
    const pointItems = [0, 1 , 2];
    const onPointChange = (index) =>{
        setPointActive(index);
    }
    return(
        <div >
            <div className='point_container'>
                {pointItems.map( (item, index) => (
                    <div className={poitactive == index ? 'point_active' : 'point_disable'} key={`${item}_${index}`}>
                    </div>
                ))
                }
                
            </div>
        </div >
        );
}


export default Success;
